Leopards: 21st Century Cats

Nature Documentary hosted by Rom Whitaker, published by BBC broadcasted as part of BBC Natural World series in 2013 - English narration

Leopards-21st-Century-Cats-Cover.jpg

Information
------------------------------

Leopards are one of India's most powerful predators. Built for strength rather than speed, they hunt in the shadows and ambush their prey. In an ever shrinking world, their lives are colliding with people - attacks are reported regularly and hundreds of these big cats are stoned, trapped or shot. What is it like living with these animals on your doorstep? And for the leopards, what does it take to survive in a world of over a billion people?

